import{_ as e,o as a,c as t,O as r}from"./chunks/framework.9482e208.js";const b=JSON.parse('{"title":"§ 23.1-1701 Membership.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/23.1-1701.md","filePath":"vacode/23.1-1701.md"}'),o={name:"vacode/23.1-1701.md"},i=r('<h1 id="§-23-1-1701-membership" tabindex="-1">§ 23.1-1701 Membership. <a class="header-anchor" href="#§-23-1-1701-membership" aria-label="Permalink to &quot;§ 23.1-1701 Membership.&quot;">​</a></h1><p>A. The board shall consist of 13 members appointed by the Governor, of whom at least two shall be alumni of the University and at least 11 shall be residents of the Commonwealth.</p><p>B. The alumni association of the University may submit to the Governor a list of at least three nominees for each vacancy on the board, whether the vacancy occurs by expiration of a term or otherwise. The Governor may appoint a member from the list of nominees.</p><p>1964, c. 159, §§ 23-185, 23-186; 1973, c. 55; 1984, c. 772; 2002, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0158" target="_blank" rel="noreferrer">158</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0257" target="_blank" rel="noreferrer">257</a>; 2008, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?081+ful+CHAP0399" target="_blank" rel="noreferrer">399</a>; 2016, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?161+ful+CHAP0588" target="_blank" rel="noreferrer">588</a>.</p>',4),n=[i];function s(l,h,c,p,m,_){return a(),t("div",null,n)}const d=e(o,[["render",s]]);export{b as __pageData,d as default};
